import React from 'react';

const Menu = ({ menu }) => {
  return (
    <li>
      {menu.menu}  
      {menu.subMenus && menu.subMenus.length > 0 && (
        <ul>

          {menu.menu_item}
        </ul>
      )}
    </li>
  );
};

export default Menu;
